import React from "react";
import "./App.css"; 
import Profile from "./js/Profile";

function App() {
  return (
    <div className="App">
      <h1>VoyageCraft</h1>
      <h2>Plan your trips effortlessly</h2>
      <Profile />
    </div>
  );
}

export default App;
